    [],nt"revision_timestamp": "2016-08-04T08:18:00.313581",nt"name": "innoko-national-wildlife-refuge-annual-narrative-report-calendar-year-2002",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Innoko
    NWR outlines Refuge accomplishments during the 2002 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, forests, fire
    management, and water rights. The wildlife section of the report discusses wildlife
    diversity, waterfowl, game mammals, fisheries resources, and marking and bird banding.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, fishing, and law enforcement. The equipment and
    facilities section of the report provides information about new construction, major
    maintenance, equipment replacement, and computer systems. Cooperative programs are
    provided at the end.",nt"license_title": "License Not Specified",nt"extras":
